import React, {Component} from "react";
import { Formik, Form, Field } from 'formik';

const Header = () => {

    const [photos, setPhotos] = useState([])
    console.log(photos)
    const open = (url) => window.open(url)

  return (
    <header className='p-2 bg-sky-700'>
          <Formik
          initialValues={{ search: '' }}
          onSubmit={async values => {
            const response = await fetch(`https://api.unsplash.com/search/photos?per_page=20&query=${values.search}`, {
              headers: {
                'Authorization': 'Client-ID qvy2y7fRCE_mIZrDJ8fevnKO8Mm29ZYhiXQSRq70mOw'
              }
            })
            const data = await response.json()
            setPhotos(data.results)
          }}
        >
          <Form>
            <Field name='search' placeholder="Busca una imagen" className="h-12 w-96 pl-10 pr-20 rounded-md z-0 focus:shadow focus:outline-none"/>
                <button class="h-12 w-20 text-white rounded-lg bg-red-500 hover:bg-red-600">Search</button>
          </Form>
        </Formik>
    </header>

  )
}

export default Header;
